CommonData.BannerCustomCSS:
/* Style the Cookie Settings link */
a[aria-label="Cookie Settings"],
a[href*="Cookie"] {
  font-family: "Futura", sans-serif !important;
  font-weight: normal !important; /* prevents bold */
}

/* Style the Accept Cookies button */
button,
input[type="button"],
input[type="submit"] {
  font-family: "Futura", sans-serif !important;
  font-weight: normal !important; /* prevents bold */
}
